import React from 'react';
import { Link } from 'react-router-dom';
import styles from './about.css';

import imagen from '../IMG/fondo_control.jpg';

function About() {
  return (
    <>
      <Link to="/home" className={styles.linkButton}>
        <button>Volver al Inicio</button>
      </Link>
      <div className={styles.container}>

        <div>
          <h1 className={styles.title}>PI HENRY VIDEOGAMES 2024</h1>
          <h1 className={styles.title}>Mirko Miler</h1>
          <img src={imagen} alt="foto" className={styles.imagen} />
        </div>

      </div>
    </>
  );
}

export default About;
